import React, { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";

interface Prefecture {
  id: number;
  name: string;
  region: string;
}

const DogCafeRegionList: React.FC = () => {
  const navigate = useNavigate();
  const [prefectures, setPrefectures ] = useState<Prefecture[]>([]);

  //店舗データの取得
  useEffect(() => {  
    const fetchPrefectures = async () => {
      try {
        const response = await fetch('http://localhost:5003/prefectures/');
        if (!response.ok) {
          throw new Error("Failed to fetch prefectures");
        }
        const data: Prefecture[] = await response.json();
        setPrefectures(data);
      } catch (error) {
        console.error("データの取得に失敗しました:", error);
      }
    };

    fetchPrefectures();
  }, []);

  const handleClick = (id: number) => {
   navigate('/dogcafe/${id}');
};
  // 地域ごとにグループ化
  const regions = prefectures.reduce<{ [key: string]: Prefecture[] }>(
    (acc, prefecture) => {
      if (!acc[prefecture.region]) {
        acc[prefecture.region] = [];
      }
      acc[prefecture.region].push(prefecture);
      return acc;
    },
    {}
  );

  return (
    <div>
      <h2>DogCafeを探す</h2>
      <div>
        {Object.keys(regions).map((region) => (
          <div key={region}>
            <h3>{region}</h3>
            {regions[region].map((prefecture) => (
              <div key={prefecture.id} onClick={() => handleClick(prefecture.id)}>
                <p>{prefecture.name}</p>
              </div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
};

export default DogCafeRegionList;
